import React from 'react';

const Banner = () => {
    return (
        <div style={{
            backgroundColor: 'lightBlue',
            color: '#000',
            padding: '10px',
            textAlign: 'center',
            position: 'fixed',
            top: '0',
            width: '100%',
            zIndex: '1000'
        }}>
            <h1>Bruin Referrals</h1>
            Sitewide Banner!
        </div>
    )
};

export default Banner;
